Read "War and Peace" and uncompress. Convert to lower case. Split into words. Split into A and B enumerations. With A, sort the words, find the unique words, and count them. With B, just count the total number of words. const warandpeace = resolve("./warandpeace.txt.gz"); const [wordsA, wordsB] = read(warandpeace) .run("gunzip").lines .map((line) => line.toLocaleLowerCase()) .run("grep", "-oE", "(\\w|')+") .tee(); const [uniqueWords, totalWords] = await Promise.all([ wordsA.run("sort").run("uniq").run("wc", "-l").lines .map((n) => parseInt(n, 10)) .first, wordsB.run("wc", "-l").lines .map((n) => parseInt(n, 10)) .first,
]); console.log(`Total: ${totalWords.toLocaleString()}`);
console.log(`Unique: ${uniqueWords.toLocaleString()}`); This is ( almost ) equivalent to: # Count unique words
cat ./warandpeace.txt.gz \ | gunzip \ | tr '[:upper:]' '[:lower:]' \ | grep -oE "(\\w|')+" \ | sort \ | uniq \ | wc -l # Count all words
cat ./warandpeace.txt.gz \ | gunzip \ | tr '[:upper:]' '[:lower:]' \ | grep -oE "(\\w|')+" \ | wc -l
